import React, {Fragment} from 'react'

const GrayImg = () => {
  return (
    <Fragment>
      <img class="gray-image" src="https://upload.wikimedia.org/wikipedia/commons/thumb/d/d9/Mercury_in_color_-_Prockter07-edit1.jpg/280px-Mercury_in_color_-_Prockter07-edit1.jpg"></img>
    </Fragment>
  )
}

export default GrayImg
